INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(1, 'Quais são as dimensões da IA?', 1, '2014-07-22 06:07:34', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(2, 'A seguinte definição: "[Automatização de] atividades que associamos ao pensamento humano, atividades como a tomada de decisões, a resolução de problemas, o aprendizado"; refere-se a:', 2, '2014-07-22 06:15:50', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(3, 'A definição:  "o estudo das faculdades mentais pelo uso de modelos computacionais", refere-se ao quadrante:', 2, '2014-07-22 06:18:16', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(4, '"A arte de criar máquinas que executam funções que exigem inteligência quando executadas por pessoas" refere-se ao seguinte quadrante:', 2, '2014-07-22 06:19:49', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(5, ' A definição de IA, "a Inteligência Computacional é o estudo do projeto de agentes inteligentes", refere-se a:', 2, '2014-07-22 06:22:08', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(6, 'Assinale com V para verdadeiro e F para falso, e depois marque a alternativa correta:\r\n\r\n(    ) A Filosofia é uma das ciências da IA\r\n(    ) A Eletricidade é uma das ciências da IA\r\n(    ) Pensar como ser humano é um dos quadrantes das definições de IA\r\n(    ) Pensar como máquina é um dos quadrantes das definições da IA\r\n', 3, '2014-07-22 06:27:35', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(7, 'Problemas que podem ser resolvidos na teoria, mas na prática levam muito tempo para que suas soluções sejam úteis. Estamos falando de:', 1, '2014-07-22 06:29:56', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(8, 'Quando a complexidade do problema tende a crescer de forma exponencial com o aumento das instâncias do problema, estamos falando de:', 1, '2014-07-22 06:31:50', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(9, 'Quais são as linhas de pesquisa da IA:\r\n\r\n(    ) linha simbólica\r\n(    ) linha conexionista\r\n(    ) linha racional\r\n(    ) linha evolucionária\r\n(    ) linha sintética', 3, '2014-07-22 06:36:31', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(10, 'Sistemas especialistas são um exemplo da linha de pesquisa:', 1, '2014-07-22 06:38:29', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(11, 'Assinale com V para verdadeiro e F para falso, e depois marque a alternativa correta:\r\n\r\n(    ) Pensar como máquina é um dos quadrantes das definições da IA\r\n(    ) A Eletricidade é uma das ciências da IA\r\n(    ) A Filosofia é uma das ciências da IA\r\n(    ) Pensar como ser humano é um dos quadrantes das definições de IA\r\n', 3, '2014-08-08 18:30:10', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(12, 'Sistemas Especialistas" (SE) são programas de computadores que buscam imitar o comportamento de especialistas humanos, dentro de um domínio de conhecimento específico. Nas definições de IA, podemos enquadrar SE como:', 2, '2014-08-08 18:34:26', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(13, 'Pode-se afirmar que ___________  uma técnica da IA desenvolvida para resolver problemas em um determinado domínio, cujo conhecimento utilizado é obtido de pessoas que são experts naquele domínio.', 2, '2014-08-08 18:37:02', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(14, 'Foi desenvolvido para resolver o problema do diagnóstico e tratamento de doenças infecciosas do sangue através de um conjunto de 400 regras. Estamos falando de:', 1, '2014-08-08 18:44:01', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(15, 'Sistema que buscava resolver o problema de se inferir as estruturas moleculares de uma substância a partir da informação espectrográfica de massa:', 1, '2014-08-08 18:45:01', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(16, 'São componentes de um sistema especialista:', 2, '2014-08-08 18:49:41', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(17, 'Relacione as proposições a seguir referentes às etapas para construção de um SE e depois marque a alternativa correta:\r\n1. Definição do domínio do problema\r\n2. Aquisição de conhecimento\r\n3. Organização e representação do conhecimento\r\n4. Implementação do SE\r\n5. Testes e validação\r\n\r\n(      ) O desenvolvimento de um SE se inicia com a especificação do domínio do problema que geralmente ocorre a partir da consulta à algumas fontes de conhecimento, tais como: livros, manuais, relatórios técnicos e principalmente da experiência e conhecimento dos especialistas\r\n(      ) Geralmente são realizados para verificar a validade das regras na base de conhecimento.\r\n(      ) Fase que consiste na coleta e análise de informações de um ou mais especialistas e qualquer outra fonte, possibilitando a produção de documentos.\r\n(      ) Uso de fatos e regras para estruturar o conhecimento coletado.\r\n(      ) Fase onde o analista escolhe uma linguagem de programação ou pacote" (shell) ', 3, '2014-08-08 19:02:34', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(18, 'Em um sistema de análise de crédito, é necessário codificar uma regra na base de conhecimento de forma quando a premissa seja tempo de trabalho maior ou igual a 2 anos, a conclusão seja a de conceder 10000 de linha de crédito. Qual a regra abaixo que representa esta especificação?\r\n\r\n1. SE tempo de trabalho <= 2 ENTÃO limite de crédito = 10000\r\n2. SE tempo de trabalho >=2 ENTÃO limite de crédito > 10000\r\n3. SE tempo de trabalho >=2 ENTÃO limite de crédito = 10000\r\n4. SE tempo de trabalho = 2 ENTÃO limite de crédito >= 10000', 3, '2014-08-08 21:06:06', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(19, 'Um SE possui as regras abaixo:\r\n\r\n1. SE temperatura > 30 graus E aquecedor = ligado ENTÃO ação = desligue aquecedor\r\n2. SE temperatura < 25 graus E aquecedor = desligado ENTÃO ação = ligue aquecedor\r\n\r\nO que acontecerá para os seguintes fatos:\r\n\r\n1. temperatura = 27 graus\r\n2. temperatura = 31 graus\r\n3. temperatura = 25 graus\r\n4. temperatura = 24 graus\r\n', 3, '2014-08-08 21:14:22', 1);
INSERT INTO "STI"."USER"."ex_questao" (ID_QUESTAO, ENUNCIADO, DIFICULDADE, DATA, ID_USUARIO) VALUES(20, 'Um robô equipado com rodas que se movimenta livremente possui três sensores ultrassom" (um direcionado para a esquerda, outro apontado para frente e o terceiro apontado para a direita) para comparar a distância de algum obstáculo. Suponha que um SE para controle do robô tenha as seguintes regras:\r\n\r\n1. SE sensor_esquerdo > 20 cm E sensor_central > 20 cm E sensor_direita > 20 cm ENTÃO ação = seguir em frente\r\n2. SE sensor_central < 20 cm ENTÃO ação = gire 180 graus\r\n3. SE sensor_esquerdo < 20 cm ENTÃO ação = gire 90 graus para a direita\r\n4. SE sensor_direito < 20 cm ENTÃO ação = gire 90 graus para a esquerda\r\n\r\nSe observarmos que o comportamento do robô é mover-se em frente e girar 180 graus continuamente:\r\n\r\n(      ) as distâncias dos sensores esquerdo e direito são menores do que 20 cm\r\n(      ) as regras 1 e 3 estão sendo executadas continuamente\r\n(      ) as regras 1 e 2 estão sendo executadas continuamente\r\n(      ) o robô está percorrendo continuamente uma trajetória entre obstáculos" (ou paredes) opostos \r\n', 3, '2014-08-08 21:41:04', 1);
